import React from 'react';
import styles from "./Account.css";

export const Account = () => {
  return (
    <div className="account">
        {<button className="btn-cart"><span class="material-symbols-outlined"></span></button>}
        {<button className="btn-not"><i className="fa fa-bell"></i></button>}
        {<button className="btn-log">Login</button>}
    </div>    
  )
}
